import Col from 'react-bootstrap/Col';
import { Container } from 'react-bootstrap';
import Slidebar from './Slidebar';
import Permission from './Permisson';

function SubElement(){
  return(<Container>
    <Row >
    <Col ><Slidebar/></Col>
    <Col ><Permission/></Col>
  </Row>
  </Container>)

}
export default SubElement
